script: |
  super -f text -I q4234.spq | sort > q4234.out

inputs:
  - name: q4234.spq
    data: |
      SELECT DISTINCT + 48 FROM tab2 (FORMAT parquet) WHERE NOT - 99 / - col1 * - 95 IN ( + ( + + 8 ), col2 / - 93 * - col1 + col2, + 41, - col2 * 73 * - col0 );
  - name: tab2

outputs:
  - name: q4234.out
    data: |
      48
